import "bootstrap/dist/css/bootstrap.min.css";
import "./css/style.css";

import {Router, Switch, Redirect, Route} from "react-router-dom";
import Index from "./pages/Index";

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path = "/" component = {Index}></Route>
      </Switch>
    </Router>
  );
}

export default App;
